pragma solidity 0.5.8;
pragma experimental ABIEncoderV2;

contract Parinsurance {
    // Model a Insurance Smart Contract
    struct Insurer {
        uint companyId;
        string companyName;
        uint empId;
        string empName;
        string empEmail;
       bool isInsured;
       Flight flight;
       Claims claim; 
    }

    struct Flight {

        string flightName;
        string flightDate;
        string flightTime;
        bool isDelayed;
    }

    struct Claims {

        uint claimsAmt;
        bool isClaimsPaid;
    }


    // Store Insurer Count
    uint public insCount;


    // Read/write Insurers
    mapping(string => Insurer) public insurers;


    // Constructor
    constructor () public {
        addInsurer("Infosys");
       // addInsurer("TCS");
    }

    function addInsurer (string memory _name) private {
        //insCount ++;
        insurers["111"] = Insurer(1, _name,0,"Employee1","sugam.shetty@gmail.com",true,Flight("AirIndia","2019-09-05","10:00",false),Claims(0,false));

    }

    


}
